import React from 'react'

export default function Calendar(props) {
  let noEarlier = Number(props.nE.substring(2, 6));
  let noLater = Number(props.nL.substring(2, 6));
  let totalHours = noLater - noEarlier;
  let numTimeSegs = totalHours * 4;
  const rows = [];
  for (let i = 0; i < numTimeSegs; i++) {
    rows.push(tableRow());
  }

  return (
    <div className='calendar'>
      <table>
        <thead>
          <tr>
            <th>Sunday</th>
            <th>Monday</th>
            <th>Tuesday</th>
            <th>Wednesday</th>
            <th>Thursday</th>
            <th>Friday</th>
            <th>Saturday</th>
          </tr>
        </thead>
        <tbody>
          {rows}
        </tbody>
      </table>
    </div>
  )
}

function tableRow() { 
  return (
    <tr>
      <td id='0'></td>
      <td id='0'></td>
      <td id='0'></td>
      <td id='0'></td>
      <td id='0'></td>
      <td id='0'></td>
      <td id='0'></td>
    </tr> 
  )
}
